package com.obpoo.gfsfabricsoftware.TransferStock.DataModel;import android.os.Parcel;import android.os.Parcelable;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class StockDocData implements Parcelable {    @SerializedName("document")    @Expose    private String document;    @SerializedName("fabrics")    @Expose    private List<StockDocFabric> fabrics = null;    protected StockDocData(Parcel in) {        document = in.readString();        fabrics = in.createTypedArrayList(StockDocFabric.CREATOR);    }    public static final Creator<StockDocData> CREATOR = new Creator<StockDocData>() {        @Override        public StockDocData createFromParcel(Parcel in) {            return new StockDocData(in);        }        @Override        public StockDocData[] newArray(int size) {            return new StockDocData[size];        }    };    public String getDocument() {        return document;    }    public void setDocument(String document) {        this.document = document;    }    public List<StockDocFabric> getFabrics() {        return fabrics;    }    public void setFabrics(List<StockDocFabric> fabrics) {        this.fabrics = fabrics;    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeString(document);        dest.writeTypedList(fabrics);    }}